INSERT OR REPLACE INTO "texts" VALUES (33776734, 'Winged Kuriboh LV9', 'During either player''s turn, as Chain Link 3 or higher: You can Special Summon this card from your hand. Spell Cards that have been activated are banished instead of being sent to the Graveyard. The ATK and DEF of this card are each equal to the number of Spell Cards in your opponent''s Graveyard x 500. You can only control 1 face-up "Winged Kuriboh LV9".', 'Special Summon', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '');
